import React from 'react';
import Cards from '../../components/Cards';
const Home = () => {
    return (
        <div className="homa-container px-5">
            <div className="row">
                <div className="col-3 card-movie-container">
                    <Cards />
                </div>
                <div className="col-3 card-movie-container">
                    <Cards />
                </div>
                <div className="col-3 card-movie-container">
                    <Cards />
                </div>
                <div className="col-3 card-movie-container">
                    <Cards />
                </div>
            </div>
        </div>
    );
};

export default Home;
